import React from "react";
import "./Cart2.css";

function Cart2(props) {
  const { vector2, vector1, vector6, vector7 } = props;

  return (
    <div className="cart2">
      <div className="group-12">
        <img className="vector-23" src={vector2} />
        <img className="vector-14" src={vector1} />
        <img className="vector-62" src={vector6} />
        <img className="vector-72" src={vector7} />
      </div>
    </div>
  );
}

export default Cart2;
